from typing import List


class Solution:
    def productExceptSelf(self, nums: List[int]) -> List[int]:
        result = [1]*len(nums)
        prefix = 1
        postfix = 1
        
        # get prefix
        for i in range(len(nums)):
            # update the current index with the prefix
            result[i] = prefix
            # update the prefix for the next itteration
            prefix *= nums[i]

        # get postfix
        for i in range(len(nums)-1, -1, -1):
            # update the current index with the postfix
            result[i] *= postfix
            # update the postfix for the next itteration
            postfix *= nums[i]
        return result

